    return(
        <div> 



  
       {items.map((e)=>
       <div key={e.id} className={cl.main}>
        <h2>{e.name}</h2>
        <p>{e.desctiprion}</p>
        <h3>{e.price}</h3>


       </div>)}
 

        
        </div>
    )
}

export default MyProduct;
